import React from 'react';
import Navigationbar from './components/Navigationbar';
import './App.css';
import Mainphoto from './Mainphoto';
import Card from "./components/Card"
import Smallphoto from "./image/image 12.png"

export default function App() {
  const cards = data.map(item => {
    return (
          <Card
            img = {item.coverImg}
            rating="5.0"
            reviewCourt= {6}
            location="usa"  
            title="life lesson with katie zaferee"
            price={136}
          />)})

    return (
    <div>
        <Navigationbar/>
        <Mainphoto/>
        <Card
          img = {Smallphoto}
          rating="5.0"
          reviewCourt= {6}
          location="usa"  
          title="life lesson with katie zaferee"
          price={136}
        />
    </div>
  );
}
